    -- N·∫øu ƒë∆°n h√†ng th√†nh c√¥ng (status = 4), c·∫≠p nh·∫≠t l∆∞·ª£t b√°n  
    ELSEIF NEW.status = 4 AND OLD.status < 4 THEN  
        -- C·∫≠p nh·∫≠t s·ªë l∆∞·ª£ng ƒë√£ b√°n cho b·∫£ng pro_variants  
